// HasDownloadJob applies the HasEdge predicate on the "download_job" edge.
func HasDownloadJob() predicate.TrackedDownload {
	return predicate.TrackedDownload(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, true, DownloadJobTable, DownloadJobColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasDownloadJobWith applies the HasEdge predicate on the "download_job" edge with a given conditions (other predicates).
func HasDownloadJobWith(preds ...predicate.DownloadJob) predicate.TrackedDownload {
	return predicate.TrackedDownload(func(s *sql.Selector) {
		step := newDownloadJobStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

